      SELECT DISTINCT 55 * COUNT ( ALL + + col0 ) + + + 2 AS col2 FROM tab0 WHERE + 55 NOT BETWEEN - col2 * col2 * + ( - CAST ( NULL AS INTEGER ) ) AND NULL;
  - name: tab0

outputs:
  - name: q10232.out
    data: |
      2
